import React,{useState,useEffect} from 'react'
const Team = (props) => {
    const team = props.teamdata
    const [teamdata,setTeamData] = useState({})
    console.log(teamdata)

    useEffect(() => {
        function showdata() {
            setTeamData(props)
        }
    }, []);



    return(
        <div className="d-flex justify-content-center">
            <div className="card" style={{width: '18rem'}}>
            <div className="card-body">
            <h5 className="card-title">{teamdata.name}</h5>
            </div>
            <ul className="list-group list-group-flush">
            <li className="list-group-item">Age: {teamdata.location_based}</li>
            <li className="list-group-item">Email: {teamdata.matches_played}</li>
            <li className="list-group-item">Contact: {teamdata.matches_won}</li>
            <li className="list-group-item">Ranking: {teamdata.matches_lost}</li>
            <li className="list-group-item">Half Centuries: {teamdata.matches_draw}</li>
            {/* <li className="list-group-item">Centuries:  {team.captain.fname} {team.captain.lname}</li> */}
            </ul>
            <div className="card-body">

            </div>
        </div>
        </div>
    )
}

export default Team
